import React from 'react'
const url = 'https://yelpapiserg-osipchukv1.p.rapidapi.com/getAutocomplete';
const options = {
	method: 'POST',
	headers: {
		'content-type': 'application/x-www-form-urlencoded',
		'X-RapidAPI-Key': '899650a0a1mshf5a08e64eca8f7dp18174djsnf4699e3e69d0',
		'X-RapidAPI-Host': 'YelpAPIserg-osipchukV1.p.rapidapi.com'
	},
	body: new URLSearchParams({
		text: '<REQUIRED>',
		accessToken: '<REQUIRED>'
	})
};

try {
	const response = await fetch(url, options);
	const result = await response.text();
	console.log(result);
} catch (error) {
	console.error(error);
}
export const photoGellery = () => {
   
  return (
    <>
      <div className="container" >
        <div className="box">
            <img src="" alt="" />
            <h2>Food</h2>
            <span>12$</span>
            <p>Lorem ipsum dolor sit amet consectetur, adipisicing elit. Doloremque alias fugit voluptates quam ex culpa ea aliquid!</p>
        </div>
      </div>
    </>
  )
}
